import React from 'react';
import SettingsIcon from '@material-ui/icons/Settings';

function ProfileCard() {
  return (
    <div>
      <div className="profile">
        <a
          href="https://ibb.co/xMfWZWL"
          style={{ paddingBottom: '10px', position: 'relative' }}
        >
          <img
            src="vinay.jpg"
            alt="michael-dam-m-EZ3-Po-FGs-k-unsplash"
            border="0"
            className="picture"
          />
        </a>
        <div
          style={{
            display: 'flex',
            alignItems: 'center',
          }}
        >
          <h2
            style={{
              color: '#535457',
              width: '50%',
              fontWeight: 'bold',
              borderBottom: '2px solid',
              marginLeft: '20px',
            }}
          >
            Good&nbsp;Morning&nbsp;Vinay!
          </h2>
          <div
            style={{
              marginLeft: 'auto',
              display: 'flex',
              alignItems: 'center',
            }}
          >
            <button
              style={{
                marginRight: '10px',
              }}
            >
              Today
            </button>
            <input
              type="text"
              placeholder="Search"
              style={{
                marginRight: '10px',
              }}
            />
          </div>
        </div>
      </div>
    </div>
  );
}

export default ProfileCard;
